   const [Username, setUsername] = useState("");
   const [pswd,SetPswd]=useState("");

var checkuname=(e)=>{
    setUsername(e.target.value)
}
var checkpswd=(e)


  return (
    <div>
        <h1 className='heading'>Login Page</h1>

        <input type='text' name='username' className='uname' value={Username} onChange={(e)=>checkuname(e)} placeholder='Username'/><br/>
        <input type='password' name='pssd' className='pswd'value={pswd} onChange={(e)=>checkpswd(e)} placeholder='Password'/>
        <button>Login</button>


    </div>
  )
}

